<?phpnamespace App\AdminBundle\Business\Base;abstract class BaseConfigBuilder{    public $container;    public function __construct($container)    {        $this->container = $container;    }    abstract function buildForm($builder, $options = array());    public function setModel(&$model, $key, $data)    {        $model[$key] = $data['value'];    }    public function getData($model)    {        return $model;    }}